            <div className="verticalSpacer"/>
            <h1 className="center">Title of the Comic</h1>
            <img src="#" alt='' className="center"/>
            <p className="center">Maybe some more comic text</p>
            </div>
        </div>
    );
};

export default ComicDisplay;
